    const { tittle, children, openPopup, setOpenPopup } = props; 
    const classes = useStyles();

    return (
        <Dialog open={openPopup} maxWidth="md" className={{ paper :classes.dialogWrapper}}>
            <DialogTitle>
                <div>Title goes here.</div>
            </DialogTitle>
            <DialogContent dividers>
                {children}
            </DialogContent>
        </Dialog>
    )
}
